import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom'
import Home from './components/pages/Home'
import Report from './components/Report/Report';
import SearchFilter from './components/search-filter';
import Hazardform from './components/Report/Hazardform';
import Trafficform from './components/Report/Trafficform';
import Accidentform from './components/Report/Accidentform';
function App() {
  return (
    <div className="App">
      <Router>
      <Navbar />
      <Routes>
          <Route path='/' exact element={<Home />}/>
          <Route path='/report' exact element={<Report />}>
            <Route path='Accident' exact element={<Accidentform />}></Route>
            <Route path="hazard" exact element={<Hazardform />}></Route>
            <Route path="traffic" exact element={<Trafficform />}></Route>
          </Route>
          <Route path='/view' exact element={<SearchFilter />}/>
      </Routes>
      </Router>

    </div>
  );
}

export default App;
